import React from 'react';
import '../App.css';

function Content(props){
    return(
        <div id="Container">
            <div id="leftchar">
                <h2>{props.firstChar.name}</h2>
            </div>
            <div id="rightchar">
                <h2>{props.secondChar.name}</h2>
            </div>
        </div>
        
    )
}

export default Content
